import { useAuth0 } from '@auth0/auth0-react'

// /api/privateへのリクエスト
function LoginAxios() {
  const { getAccessTokenSilently } = useAuth0();

    useEffect(
      () => {
        axios.get("http://localhost:3000/api/private", { headers: "JWT" + getAccessTokenSilently
        })
        .then((res) => {
          return res;
        })
        .catch((err) => {
          console.log(err);
        });
        alert(JSON.stringify(Response));
        alert(getAccessTokenSilently)
      });
}
export default LoginAxios;
